import "../styles/home.css";

import SocialMedia from "./socialMedia";
import Skills from "./skills";
export default function LeftSide() {
	return (
		<div className="fullLeftSIde">
            <div className="header">
                <div className="pictureMouad"></div>
                <div className="nameMouad">Mouad Ajmani</div>
            </div>
            <div className="left_side">
                <Skills name="HTML" picture="html" />
            </div>
            <div className="right_side">

            </div>
            <div className="footerLeftSide">
                <SocialMedia lien="https://www.linkedin.com/in/mouad-ajmani-21071021b/" name="Mouad Ajmani" nameIcon="linkedin" />
                <SocialMedia lien="https://github.com/majmani1" name="majmani1" nameIcon="github"/>
            </div>
		</div>
	);
}
